script: |
  super -f text -I q7378.spq | sort > q7378.out

inputs:
  - name: q7378.spq
    data: |
      SELECT - 13 + col2 / + col1 * - col0 + - col1 + - 66 AS col1, + col2 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN col1 AND - - col2;
  - name: tab2

outputs:
  - name: q7378.out
    data: |
